import React, { Component } from'react';
import { Carousel } from 'react-bootstrap';


class Sliders extends Component {
    render () {
        return (
            <Carousel viewportWidth="400px">
            <Carousel.Item>
                <img width={900} height={500} alt="900x500" src="/src/assests/ant.jpeg" />
                <Carousel.Caption>
                <p>Pic 1</p>
                </Carousel.Caption>
            </Carousel.Item>
            <Carousel.Item>
                <img width={900} height={500} alt="900x500" src="/src/assests/mountains.jpeg" />
                <Carousel.Caption>
                <p>Pic Item 2</p>
                </Carousel.Caption>
            </Carousel.Item>
            <Carousel.Item>
                <img width={900} height={500} alt="900x500" src="/src/assests/Sunset.jpeg" />
                <Carousel.Caption>
                <p>Pic Item 3</p>
                </Carousel.Caption>
            </Carousel.Item>
            </Carousel>            
        );
    }
};

export default Sliders;
